export default function Gender() {
  return (
    <>
      {/* BACKGROUND GRADIENT COLOR */}
      <div className="flex items-center justify-center h-screen bg-gradient-to-r from-[#ff6b6b] to-[#1eae98]">
        {/* CARD CONTAINER */}
        <div className="bg-white p-12 rounded-lg shadow-md max-w-4xl">
          {/* JUDUL */}
          <h1 className="text-4xl font-bebas mb-4 text-center">
            SELAMAT DATANG DI APLIKASI SISTEM PAKAR KLASIFIKASI DIABETES
          </h1>
        </div>
      </div>
    </>
  );
}
